 express = require('express');
const router = express.Router();
const array = [
    {id: 1,
       title: 'student',
        createdOn: new Date()},
    {id: 2, 
      title: 'employee',
       createdOn: new Date()},
    {id: 3, 
      title: 'employer', 
      createdOn: new Date()},
    {id: 4,
       title: 'unemployee',
        createdOn: new Date()},
    {id: 5,
      title: 'parent', 
      createdOn: new Date()},
];
// Get all id by default
router.get('/', (req, res) => {
  return res.status(200).send({
      status: 200,
      message: 'Welcome to myDiary '
  });
});
// Get entry by id
router.get('/:id', function (req, res) {
  let found = array.find(function (item) {
      return item.id === parseInt(req.params.id);
  });
  if (found) {
      res.status(200).json(found);
  } else {
      res.sendStatus(404);
  }
});

//add entries
router.post("/", (req, res) => {
  let Ids = array.map(item => item.id);
 
  let newId = Ids.length  ;
  let newItem = {
    id: newId,
    title: req.body.title,
    createdOn: new Date()
  };
  array.push(newItem);
 
    res.status(201).json(newItem);

});
//put items


module.exports = router;

